import './App.css'

import logo from './logo.svg'
import { text } from './text-sample'

const re1 = /[\d]{0,3}[\w]{0,2}[\d]{7,}/

function App() {
	return (
		<div className='App'>
			{text.match(re1).map((res) => (
				<p>res</p>
			))}
		</div>
	)
}

export default App
